import Auth from "../../containers/auth/auth";
import classes from './layout.module.css';

const Layout = () => {

    return(
        <div>
            <header>
                <nav><h1>profiles</h1></nav>
            </header>
            <main>
                <Auth />
            </main>
            <footer className={classes.layoutFooter}></footer>
        </div>
    );
};

export default Layout;
